import React from "react";
//Permet de naviguer entre les pages (react-router-dom)
import { NavLink } from "react-router-dom";

const Navigation = () => {
  return (
    <div className="navigation">
      <ul>
        <NavLink to="/">
          <li>acceuil</li>
          <img src="sqdj.png"></img>
        </NavLink>
        <NavLink to="/about">
          <li> A propos </li>
        </NavLink>
      </ul>
    </div>
  );
};

export default Navigation;
